function fn(r,a){for(var n=0,c=0;c<r.length;c++)r[c]==a&&n++;return n}function change(r){for(var a=0,n=0,c="";a<r.length;a++){var e=r.substr(a,1),o=r.split(e);o.length-1>n&&(c=e+","+(n=o.length-1))}return c}function fun3(r,a,n){for(var c=r.length-1;c>=a;c--)r[c+1]=r[c];r[a]=n}function indexfun(r,a){for(var n=0;n<r.length;n++)if(r[n]==a)return n;return-1}for(var arr=[5,8,3,6,9],i=0;i<arr.length;i++)for(var j=i+1;j<arr.length;j++)if(arr[i]>arr[j]){var temp;temp=arr[i],arr[i]=arr[j],arr[j]=temp}console.log(arr);for(var str="abcdefgaaass",newarr=str.split(""),max=0,val="",i=0;i<newarr.length;i++){var ind=fn(newarr,newarr[i]);ind>max&&(max=ind,val=newarr[i])}console.log("出现最多的字符是"+val+"出现的次数是"+max);var strr="aaasssssbbbcccccccccccccccccccccc";console.log(change(strr)),fun3(arr=["1411A","44","34305","djg","pic"],2,"hello"),console.log(arr);var brr=[5,9,6,3,2,5];console.log(indexfun(brr,13));